/*************************************************/
 /*延时*/
/*************************************************/
void delay(void)    
{
	unsigned char i,j;
	
	for (i = 32; i > 0; i--)
		for (j = 255; j > 0; j--);
}

 /*************************************************/
 /*延时*/
/*************************************************/
void delay1(void)    
{
	int i,j;
	for (i = 1000; i > 0; i--)
	{
		for (j = 255; j > 0; j--) 
		{
			nop();
			nop();
			nop();
			nop();
			nop();
			nop();
			nop();
			nop();
		}
	}
}

void lcd_spi_init()
{
	HSPIM_InitTypeDef HSPIM_InitStruct;

	GPIO_PinRemapConfig(GPIOC, GPIO_Pin_13 | GPIO_Pin_15 , GPIO_Remap_3);
	
	HSPIM_InitStruct.HSPIM_Enable = ENABLE;
	HSPIM_InitStruct.HSPIM_Mode = HSPIM_MODE_STANDARD;
	HSPIM_InitStruct.HSPIM_CPOL = HSPIM_CPOL_LOW;
	HSPIM_InitStruct.HSPIM_CPHA = HSPIM_CPHA_1EDGE;
	HSPIM_InitStruct.HSPIM_FirstBit = HSPIM_FIRST_BIT_MSB;
	HSPIM_InitStruct.HSPIM_DivideEnable = ENABLE;
	HSPIM_InitStruct.HSPIM_BaudRatePrescaler = HSPIM_BAUDRATE_PRESCALER_2;
	HSPIM_InitStruct.HSPIM_RXFIFOFullThreshold = HSPIM_RX_FIFO_FULL_THRESHOLD_8;
	HSPIM_InitStruct.HSPIM_TXFIFOEmptyThreshold = HSPIM_TX_FIFO_EMPTY_THRESHOLD_8;
	
	HSPIM_Init(&HSPIM_InitStruct);
	HSPIM_TransmitCmd(ENABLE);	
}
 
