/*************************************************/
//写命令
/*************************************************/
void wcom(unsigned char com)
{ 
	SET_LCD_CS_LOW();
	nop();
	SET_LCD_A0_LOW();
	nop();
	write(com);
	nop();
	nop(); 
	SET_LCD_CS_HIGH();
}

/*************************************************/
//写数据
/*************************************************/
void wdata(unsigned char dat)
{
	SET_LCD_CS_LOW();
	nop();
	SET_LCD_A0_HIGH();
	nop();
	write(dat);  
	nop(); 
	SET_LCD_CS_HIGH();
}

